import React from "react";
import { Col, Row, Container } from "../components/Grid";
import Jumbotron from "../components/Jumbotron";

function Contact() {
  return (
    <Container fluid>
      <Row>
        <Col size="md-12">
          <Jumbotron>
            Contact Information
            <br>
            </br>
            phone: 5127438019
            <br>
            </br>
            email: info@512global.com
            <br></br>
          </Jumbotron>
        </Col>
      </Row>
    </Container>
  );
}

export default Contact;
